import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/project1">Work</Link>
        </li>
        <li>
          <Link to="/project2">About</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
